import React from 'react';
import axios from 'axios';

class GradeResult extends React.Component {
  constructor(props) {
    super(props);
  }

  get_result(event) {
    event.preventDefault();
    const data = new FormData(event.target);

    axios({
      url: 'https://asag-api.herokuapp.com/',
      method: 'post',
      data: data,
    })
    .then(function (response) {
      let grade = response.data.grade;
      return (
        <div>
          <br/><br/><br/>
          <hr/>
          <br/><br/>
          Grade:&nbsp;&nbsp;
          <div
            name="grade"
            checked={grade}>
          </div>
          <br /><br />
        </div>
        );
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
  }

  render() {
    return  (
      <div/>
    );
  }
}

export default GradeResult;
